import {makePostHelper} from "../javascript/Server"
const expectPass = (func,...args) =>  {
    try {
        func(...args)
    } catch (exception) {
        return exception
    }
}

const testMakeFalsyPost = () => {
    const flawPostObj = {
        author : "Wonjae Lee"
    }

    expectPass(makePostHelper, "testPosts", flawPostObj)
}

export const runTests = () => {
    testMakeFalsyPost();
}
